description:
Vengeance (2009)  

Hongkong / Frankrijk
Misdaad / Thriller
108 minuten

geregisseerd door Johnnie To
met Johnny Hallyday, Simon Yam en Anthony Wong Chau-Sang

Een huurmoordenaar voor de onderwereld vertrekt vanuit HongKong naar Frankrijk om daar te leven. Na enige tijd wordt hij gedwongen om terug te keren, om wraak te nemen op de moord van de familie van zijn dochter.

